CREATE FUNCTION pms.create_dn(tex_customer_code text, tex_project_code text, tex_package_supplier_code text, tstmp_promised_date timestamp with time zone, tstmp_delivery_date timestamp with time zone, tex_destination text, tex_business_type text, tex_truck_no text, tim_time_to_destination time with time zone, tex_updated_by text) RETURNS text
    LANGUAGE plpgsql
    AS $_$
DECLARE     

	int_order_line INTEGER;
	tex_dn_no TEXT;


BEGIN

--	SELECT * FROM pms.package_order

	SELECT COUNT(1) FROM pms.package_order 
	WHERE status = 'MATCH' AND customer_code = tex_customer_code AND project_code = tex_project_code AND 
	package_supplier_code = tex_package_supplier_code AND promised_date = tstmp_promised_date AND 
	delivery_date = tstmp_delivery_date AND destination = tex_destination AND business_type = tex_business_type AND 
	truck_no = tex_truck_no AND time_to_destination = tim_time_to_destination INTO int_order_line;

	IF (int_order_line > 0) THEN

		-- get next edn seq
		EXECUTE 'SELECT pms.next_dn_no($1, $2, $3, $4)' 
		USING tex_customer_code, tex_project_code, tex_package_supplier_code, tstmp_promised_date INTO tex_dn_no;

		--insert dn
			promised_date, delivery_date, business_type, truck_no, time_to_destination,
			order_line, dn_status,  updated_by)
		VALUES (tex_dn_no, RIGHT(tex_dn_no,3), tex_customer_code, tex_project_code, tex_package_supplier_code, tex_destination, 
			tstmp_promised_date, tstmp_delivery_date, tex_business_type, tex_truck_no, tim_time_to_destination, 
			int_order_line, 'DN', tex_updated_by);
		
		--update package_order
		UPDATE pms.package_order SET dn_no = tex_dn_no, status = 'DN', updated_by = tex_updated_by
		WHERE status = 'MATCH' AND customer_code = tex_customer_code AND project_code = tex_project_code AND 
		package_supplier_code = tex_package_supplier_code AND promised_date = tstmp_promised_date AND 
		delivery_date = tstmp_delivery_date AND destination = tex_destination AND business_type = tex_business_type AND 
		truck_no = tex_truck_no AND time_to_destination = tim_time_to_destination;
		
	END IF;
	

RETURN tex_dn_no; 
END;$_$;


