			rec.business_type, rec.truck_no, rec.time_to_destination, tex_updated_by INTO tex_dn_no;

			--status = 'DN'

			SELECT dn_no, customer_code, project_code, package_supplier_code, destination, promised_date, delivery_date, business_type, order_line, 'DN'
			FROM pms.dn WHERE dn_no = tex_dn_no AND flag_delete = false LIMIT 1;
		

		END LOOP;

	
RETURN QUERY SELECT * FROM temp_dn order by dn_no;
END;$_$;


