--
-- TOC entry 245 (class 1255 OID 633398)
-- Name: next_dn_no(text, text, text, timestamp with time zone); Type: FUNCTION; Schema: pms; Owner: postgres
--

CREATE FUNCTION pms.next_dn_no(tex_customer_code text, tex_project_code text, tex_package_supplier_code text, tstmp_promised_date timestamp with time zone) RETURNS text
    LANGUAGE plpgsql
    AS $$

DECLARE     
	tex_date text;
	tex_last_seq text;
	tex_next_seq text;
	tex_s_seq text;
	tex_next_dn_no text;
	
BEGIN

	tex_date = to_char(tstmp_promised_date, 'YYMMdd');

	-- select last_seq
	SELECT MAX(dn_seq) INTO tex_s_seq FROM pms.dn 
	WHERE customer_code = tex_customer_code AND project_code = tex_project_code AND 
	package_supplier_code = tex_package_supplier_code AND promised_date = tstmp_promised_date;
	
	tex_last_seq:= '0000';
	
	IF (tex_s_seq IS NOT NULL) THEN
		tex_last_seq = tex_s_seq;
	END IF;

	tex_next_seq = to_char((tex_last_seq::integer + 1), 'FM000');
	

	tex_next_dn_no = tex_package_supplier_code || tex_date || tex_next_seq;
	
	
RETURN tex_next_dn_no; 
END;
$$;


