CREATE FUNCTION pms.process_buyer_order() RETURNS boolean
    LANGUAGE plpgsql
    AS $_$

DECLARE
	
		rec RECORD;
		tex_order_type TEXT;
		tex_result TEXT;
	
BEGIN
	
	FOR rec IN SELECT * FROM pms.raw_buyer_order WHERE status is null LOOP
		tex_result = 'SUCCESS';
		--check action
		IF (rec.action = 'A' OR rec.action = 'E') THEN
			--insert into part order (check if exist then error)
			IF EXISTS (SELECT 1 FROM pms.part_order WHERE customer_code = rec.customer_code AND project_code = rec.project_code AND
					  number = rec.number AND item = rec.item AND supplier_site = rec.supplier_site) THEN
				tex_result = 'ERROR:ORDER ALREADY EXISTS'; 
			ELSE
				
				IF (rec.action = 'A') THEN
					tex_order_type = 'NORMAL';
				ELSIF (rec.action = 'E') THEN
					tex_order_type = 'EMERGENCY';
				END IF;
				
				--insert into part_order
				freight_erms, cancelled, cancelled_date, item, supplier_item, item_desc, 
				uom, quantity, supplier_name, supplier_site, need_by_date, 
				promised_date, quantity_due, quantity_received, quantity_accepted, 
				quantity_rejected, quantity_billed, quantity_cancelled, authorization_status, 
				buyer, creation_date, filler, status, file_name, updated_by, updated_timestamp)
				VALUES (tex_order_type, rec.number, rec.revision_no, rec.line_no, rec.shipment, 
				rec.freight_erms, rec.cancelled, rec.cancelled_date, rec.item, rec.supplier_item, rec.item_desc, 
				rec.uom, rec.quantity, rec.supplier_name, rec.supplier_site, rec.need_by_date, 
				rec.promised_date, rec.quantity_due, rec.quantity_received, rec.quantity_accepted, 
				rec.quantity_rejected, rec.quantity_billed, rec.quantity_cancelled, rec.authorization_status, 
				rec.buyer, rec.creation_date, rec.filler, null, rec.file_name, rec.updated_by, current_timestamp);
				
				--update status in pms.raw_buyer_order
				UPDATE pms.raw_buyer_order SET status = 'P' WHERE record_id = rec.record_id;
			
			END IF;

		ELSIF (rec.action = 'U') THEN

			IF EXISTS (SELECT 1 FROM pms.part_order WHERE customer_code = rec.customer_code AND project_code = rec.project_code AND
					  number = rec.number AND item = rec.item AND supplier_site = rec.supplier_site) THEN
				
				--UPDATE in package_master -> call update package_order function
				--call update package_order(raw_buyer_order.record_id)
				EXECUTE 'SELECT pms.update_package_order($1)' USING rec.record_id INTO tex_result;
				
				IF (tex_result = 'SUCCESS') THEN
					--UPDATE part order
					UPDATE pms.part_order SET promised_date = rec.promised_date, revision_no = rec.revision_no, 
					line_no = rec.line_no, truck_no = null, time_to_destination = null, status = null
					WHERE customer_code = rec.customer_code AND 
					project_code = rec.project_code AND number = rec.number AND item = rec.item AND 
					supplier_site = rec.supplier_site;
					
					--update status in buyer order
					UPDATE pms.raw_buyer_order SET status = 'P' WHERE record_id = rec.record_id;
			
				END IF;
				
			ELSE
				tex_result = 'ERROR:ORDER DOES NOT EXISTS';
			END IF;

		ELSIF (rec.action = 'D') THEN
			
			IF EXISTS (SELECT 1 FROM pms.part_order WHERE customer_code = rec.customer_code AND project_code = rec.project_code AND
					  number = rec.number AND item = rec.item AND supplier_site = rec.supplier_site) THEN
				
				--Delete From package_order by id
				--call delete package_order(raw_buyer_order.record_id)
				EXECUTE 'SELECT pms.delete_package_order($1)' USING rec.record_id INTO tex_result;
				
				--UPDATE flag delete
				UPDATE pms.part_order SET flag_delete = true 
				WHERE number = rec.number 
				AND item = rec.item AND supplier_site = rec.supplier_site;
					  
				--update status in buyer order
				UPDATE pms.raw_buyer_order SET status = 'P' WHERE record_id = rec.record_id;
			
			ELSE
				--log error in order process log -> Order Does Not Exists
				tex_result = 'ERROR:ORDER DOES NOT EXISTS';

			END IF;

		END IF;
		
		IF (tex_result = 'SUCCESS') THEN
			--update order process log if exists
		
		ELSE
			--log error in order process log
			
		END IF;
	
	END LOOP;

	--call process part order
	EXECUTE 'SELECT pms.process_part_order()';

RETURN true;
END;
$_$;


