--
-- TOC entry 244 (class 1255 OID 633140)
-- Name: process_part_order(); Type: FUNCTION; Schema: pms; Owner: postgres
--

CREATE FUNCTION pms.process_part_order() RETURNS boolean
    LANGUAGE plpgsql
    AS $$

DECLARE
	
		buyer_rec RECORD;
		transport_rec RECORD;
		bom_rec RECORD;
		part_rec RECORD;
		
		tex_business_type TEXT;
		int_order_qty INTEGER;
	
BEGIN
	

	FOR buyer_rec IN (SELECT * FROM pms.part_order WHERE status IS NULL) LOOP
		
		IF EXISTS (SELECT 1 FROM master.master_bom WHERE customer_code = buyer_rec.customer_code AND
			  project_code = buyer_rec.project_code AND supplier_code = buyer_rec.supplier_site AND
			  part_no = buyer_rec.item AND status = 'ACTIVE' AND (business_type = 'EXPORT' OR business_type = 'ALL')) THEN
			  
			--Look up BOM
			FOR bom_rec IN (SELECT * FROM master.master_bom WHERE customer_code = buyer_rec.customer_code
					AND project_code = buyer_rec.project_code AND supplier_code = buyer_rec.supplier_site 
					AND part_no = buyer_rec.item AND status = 'ACTIVE' AND (business_type = 'EXPORT' OR business_type = 'ALL')) LOOP

				--check exist in package_order
				IF EXISTS (SELECT 1 FROM pms.package_order WHERE customer_code = buyer_rec.customer_code 
						AND project_code = buyer_rec.project_code AND po_no = buyer_rec.number AND supplier_code = buyer_rec.supplier_site
						AND part_no = buyer_rec.item) THEN
					
					--error log

				ELSE
				
					--check part separate business_type or not
					--if separate -> look up ratio
					FOR part_rec IN (SELECT * from master.master_part LEFT JOIN master.master_business_type_ratio 
					ON master_part.separate_business_type = true WHERE part_no = buyer_rec.item) LOOP
					
						tex_business_type = null;
						int_order_qty = null;
						RAISE NOTICE '%, %, %, %', buyer_rec.item, part_rec.separate_business_type, buyer_rec.quantity, part_rec.percentage;
						IF (part_rec.separate_business_type = false) THEN
						
							--part_rec.separate_business_type = false -> tex_business_type = ALL, int_order_qty = buyer_rec.quantity
							tex_business_type = 'ALL';
							int_order_qty = buyer_rec.quantity;
							
							RAISE NOTICE 'order_qty ALL %', int_order_qty;
							
						ELSE 
							--part_rec.separate_business_type = true -> tex_business_type = part_rec.business_type
							--int_order_qty : export -> order_qty x percentage then roundup
							tex_business_type = part_rec.business_type;
							IF (part_rec.priority = 1) THEN
								int_order_qty = ceil((part_rec.percentage*buyer_rec.quantity)/100);
							ELSE
								int_order_qty = buyer_rec.quantity - ceil(((100 - part_rec.percentage)*buyer_rec.quantity)/100);
							END iF;
							
						--	RAISE NOTICE 'order_qty % %', tex_business_type, int_order_qty;
						
						END IF;
						
						--insert order
						order_qty, promised_date, delivery_date, business_type, destination, package_supplier_code, package_no, 
						package_qty, updated_by, updated_timestamp)
						VALUES (buyer_rec.customer_code, buyer_rec.project_code, buyer_rec.number, buyer_rec.supplier_site, buyer_rec.item, 
						int_order_qty, buyer_rec.promised_date, buyer_rec.promised_date, tex_business_type, part_rec.destination,
						bom_rec.package_supplier_code, bom_rec.package_no, bom_rec.package_qty*int_order_qty, 'SYSTEM', current_timestamp);
					
					END LOOP;
				
				END IF;

			END LOOP;

			--update status
			UPDATE pms.part_order SET status = 'B' WHERE record_id = buyer_rec.record_id;

		END IF;
	
	
	END LOOP;
		
		
	FOR transport_rec IN (SELECT * FROM pms.part_order WHERE status = 'B' AND truck_no IS NOT NULL) LOOP
	
		IF EXISTS (SELECT 1 FROM pms.package_order WHERE customer_code = transport_rec.customer_code 
				AND project_code = transport_rec.project_code AND po_no = transport_rec.number 
				AND supplier_code = transport_rec.supplier_site AND part_no = transport_rec.item) THEN
			
			--update truck_no, time_to_destination, status = MATCH
			UPDATE pms.package_order SET truck_no = transport_rec.truck_no, 
			time_to_destination = transport_rec.time_to_destination, status = 'MATCH'
			WHERE customer_code = transport_rec.customer_code AND project_code = transport_rec.project_code 
			AND po_no = transport_rec.number AND supplier_code = transport_rec.supplier_site AND part_no = transport_rec.item;
						
		END IF;
		
		--change status to T
		UPDATE pms.part_order SET status = 'T' WHERE record_id = transport_rec.record_id;
		
	END LOOP;
	
	
	

RETURN true;
END;
$$;


