    AS $_$

DECLARE
	
		rec RECORD;
		emer_rec RECORD;
		int_old_quantity INTEGER;
		tstmp_old_promised_date TIMESTAMP WITH TIME ZONE;
		tex_old_truck_no TEXT;
		tim_old_time_to_destination TIME WITH TIME ZONE;
		tex_result TEXT;
		tex_raw_status TEXT;
	
BEGIN
	
	-- ACTION -> FORECAST, FIRM, TRANSPORT, EMERGENCY
	
	FOR rec IN (SELECT * FROM pms.raw_order_firm WHERE status is null) LOOP
		int_old_quantity = null;
		tstmp_old_promised_date = null;
		tex_old_truck_no = null;
		tim_old_time_to_destination = null;
		tex_raw_status = 'P';
		IF (rec.action = 'FORECAST' OR rec.action = 'FIRM') THEN
			-- INSERT/UPDATE in part_order -> update only promised_date, qty
			-- UNIQUE -> po_no, supplier_code, part_no
			IF EXISTS (SELECT 1 FROM pms.part_order WHERE customer_code = rec.customer_code AND project_code = rec.project_code AND
					  number = rec.number AND item = rec.item AND supplier_site = rec.supplier_site) THEN
				
				-- Need To check whether data change or not
				SELECT quantity, promised_date into int_old_quantity, tstmp_old_promised_date FROM pms.part_order
				WHERE customer_code = rec.customer_code AND project_code = rec.project_code AND
				number = rec.number AND item = rec.item AND supplier_site = rec.supplier_site;
				
				IF (rec.quantity != int_old_quantity OR rec.promised_date != tstmp_old_promised_date) THEN
				
					--UPDATE in package_master -> call update package_order function
					--call update package_order(raw_buyer_order.record_id, action)
--					EXECUTE 'SELECT pms.update_package_order($1,$2)' USING rec.record_id, rec.action INTO tex_result;
					
					UPDATE pms.part_order SET promised_date = rec.promised_date, revision_no = rec.revision_no, 
					line_no = rec.line_no, truck_no = null, time_to_destination = null, status = null
					WHERE customer_code = rec.customer_code AND project_code = rec.project_code AND 
					number = rec.number AND item = rec.item AND supplier_site = rec.supplier_site;
				ELSE
					tex_raw_status = 'I';
				END IF;
			
			ELSE
				--INSERT into part_order
				line_no, shipment, freight_erms, cancelled, cancelled_date, item, 
				supplier_item, item_desc, uom, quantity, supplier_name, supplier_site, 
				need_by_date, promised_date, quantity_due, quantity_received, quantity_accepted, 
				quantity_rejected, quantity_billed, quantity_cancelled, authorization_status, 
				buyer, creation_date, filler, status, file_name, updated_by, updated_timestamp)
				VALUES (rec.customer_code, rec.project_code, rec.action, rec.number, rec.revision_no, 
				rec.line_no, rec.shipment, rec.freight_erms, rec.cancelled, rec.cancelled_date, rec.item, 
				rec.supplier_item, rec.item_desc, rec.uom, rec.quantity, rec.supplier_name, rec.supplier_site, 
				rec.need_by_date, rec.promised_date, rec.quantity_due, rec.quantity_received, rec.quantity_accepted, 
				rec.quantity_rejected, rec.quantity_billed, rec.quantity_cancelled, rec.authorization_status, 
				rec.buyer, rec.creation_date, rec.filler, null, rec.file_name, rec.updated_by, current_timestamp);
					  
			END IF;
	
		ELSIF (rec.action = 'TRANSPORT') THEN
			
			IF EXISTS (SELECT 1 FROM pms.part_order WHERE customer_code = rec.customer_code AND project_code = rec.project_code AND
					  number = rec.number AND item = rec.item AND supplier_site = rec.supplier_site) THEN
					  
				-- Need To check whether data change or not
				SELECT truck_no, time_to_destination into tex_old_truck_no, tim_old_time_to_destination FROM pms.part_order
				WHERE customer_code = rec.customer_code AND project_code = rec.project_code AND
				number = rec.number AND item = rec.item AND supplier_site = rec.supplier_site;
				
	--			RAISE NOTICE 'number: %, item: %, supplier: %', rec.number, rec.item, rec.supplier_site;
	--			RAISE NOTICE 'Transport: truck_no -> %, time_to_destination -> %', tex_old_truck_no, tim_old_time_to_destination;
				
				IF (coalesce(rec.truck_no,'') != coalesce(tex_old_truck_no,'') OR (rec.time_to_destination != tim_old_time_to_destination) AND tim_old_time_to_destination IS NOT NULL) THEN
				
					--UPDATE in package_master -> call update package_order function
					--call update package_order(raw_buyer_order.record_id, action)
--					EXECUTE 'SELECT pms.update_package_order($1,$2)' USING rec.record_id, rec.action INTO tex_result;
					
					UPDATE pms.part_order SET truck_no = rec.truck_no, time_to_destination = rec.time_to_destination
					WHERE customer_code = rec.customer_code AND project_code = rec.project_code AND 
					number = rec.number AND item = rec.item AND supplier_site = rec.supplier_site;
				ELSE
					tex_raw_status = 'I';
				END IF;
				
			ELSE
				--need to insert
				line_no, shipment, freight_erms, cancelled, cancelled_date, item, 
				supplier_item, item_desc, uom, quantity, supplier_name, supplier_site, 
				need_by_date, promised_date, quantity_due, quantity_received, quantity_accepted, 
				quantity_rejected, quantity_billed, quantity_cancelled, authorization_status, 
				buyer, creation_date, filler, status, file_name, updated_by, updated_timestamp,
				truck_no, time_to_destination)
				VALUES (rec.customer_code, rec.project_code, rec.action, rec.number, rec.revision_no, 
				rec.line_no, rec.shipment, rec.freight_erms, rec.cancelled, rec.cancelled_date, rec.item, 
				rec.supplier_item, rec.item_desc, rec.uom, rec.quantity, rec.supplier_name, rec.supplier_site, 
				rec.need_by_date, rec.promised_date, rec.quantity_due, rec.quantity_received, rec.quantity_accepted, 
				rec.quantity_rejected, rec.quantity_billed, rec.quantity_cancelled, rec.authorization_status, 
				rec.buyer, rec.creation_date, rec.filler, null, rec.file_name, rec.updated_by, current_timestamp, 
				rec.truck_no, rec.time_to_destination);
	
			
			END IF;
			

		END IF;
		
		UPDATE pms.raw_order_firm SET status = tex_raw_status WHERE record_id = rec.record_id;

	END LOOP;
	
	FOR emer_rec IN (SELECT * FROM pms.raw_emergency_order WHERE status is null) LOOP
		tex_raw_status = 'P';
		
		--EXISTS -> tex_status = null (not process)
		IF EXISTS (SELECT 1 FROM pms.part_order WHERE customer_code = emer_rec.customer_code AND project_code = emer_rec.project_code AND
				number = emer_rec.po_no AND item = emer_rec.part_no AND supplier_site = emer_rec.supplier_code) THEN
			-- Need to update???
		
		ELSE
			
			--INSERT into part_order
			item_desc, quantity, supplier_site, promised_date, status, file_name, updated_by, updated_timestamp)
			VALUES (emer_rec.customer_code, emer_rec.project_code, 'EMERGENCY', emer_rec.po_no, emer_rec.part_no, 
			emer_rec.part_name, rec.quantity, emer_rec.supplier_code, emer_rec.promised_date, null, 
			rec.file_name, rec.updated_by, current_timestamp);
		
		END IF;
	
		UPDATE pms.raw_emergency_order SET status = tex_raw_status WHERE record_id = emer_rec.record_id;
	
	END LOOP;

	--call process part order
	EXECUTE 'SELECT pms.process_part_order()';

RETURN true;
END;
$_$;


ALTER FUNCTION pms.process_raw_order() OWNER TO postgres;

