CREATE VIEW master.view_master_bom AS
 SELECT b.bom_id,
    b.customer_code,
    b.project_code,
    b.supplier_code,
    b.part_no,
    p.image AS part_image,
    b.package_supplier_code,
    b.package_no,
    k.image AS package_image,
    b.package_qty,
    b.uom,
    b.business_type,
    b.status,
    b.remark,
    b.updated_by,
    b.updated_timestamp
   FROM ((master.master_bom b
     LEFT JOIN master.master_part p ON (((((p.customer_code = b.customer_code) AND (p.project_code = b.project_code)) AND (p.supplier_code = b.supplier_code)) AND (p.part_no = b.part_no))))
     LEFT JOIN master.master_package k ON (((((k.customer_code = b.customer_code) AND (k.project_code = b.project_code)) AND (k.supplier_code = b.package_supplier_code)) AND (k.package_no = b.package_no))));


